import React from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import GetMockData from './GetMockData'

const select = [
    {index: 0, name: 'Breakfast', food: 'yum', products: ['bread', 'eggs', 'milk']},
    {index: 1, name: 'Dinner', food: 'yum', products: ['steak', 'ketchup', 'fries']},
    {index: 2, name: 'Snacks', food: 'yum', products: ['chips', 'grapes', 'cookies']},
    {index: 3, name: 'Drinks', food: 'yum', products: ['Pepsi', 'Coke', 'orange juice']},
]

export class ShoppingList extends React.Component {
    render() {
        return(
            <section className="listoflists">
                <h1>Shopping Lists</h1>

                    {select.map(listName => (
                            <p>
                                <GetMockData
                                    key={listName.name}
                                    name={listName.name}
                                    food={listName.food}
                                />
                            </p>
                    ))}

                </section>
        );
    }

}
export default ShoppingList;
